(1, 'uploads/about/img-1.png', 'About Us', 'As Quick as a Click', 'On the lookout for a reliable delivery partner? Look no further – we\'re dedicated to delivering precise services. Our guiding principle is \"As Quick as a Click.\" Manage, monitor, and supervise deliveries in real-time with the ZiDrop Application. Specifically crafted for E-commerce operations, it ensures efficient transaction management, visibility, and seamless payment reconciliations.\r\n\r\nEngaged in online selling? Embrace the ZIDrop Express Cash On Delivery Service for a hassle-free payment solution. Secure payment for your products upon delivery is guaranteed. We\'ll handle the collection at the customer\'s doorstep and promptly remit the funds directly to your bank account. Exclusively tailored for eCommerce shippers.', 1, '2021-02-09 06:55:28', '2024-01-16 12:18:37');
