INSERT INTO `notices` (`id`, `title`, `slug`, `text`, `status`, `published`, `created_at`, `updated_at`) VALUES
(11, 'Happy New Year 2️⃣0️⃣2️⃣4️⃣  🎇💥', 'happy-new-year-2️⃣0️⃣2️⃣4️⃣--🎇💥', '<p>Dear Valued Customers,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As we bid farewell to the old and embrace the new, we extend our warmest wishes to you for a joyous and prosperous New Year! Thank you for being an integral part of our journey. May the coming year bring you happiness, success, and countless moments of joy. We look forward to serving you with dedication and excellence in the days ahead. Cheers to a wonderful year filled with endless possibilities!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Warm regards,</p>\r\n\r\n<p><strong>ZiDrop Logistics</strong></p>', 1, 0, '2024-01-05 20:45:22', '2024-01-30 20:14:14'),
(12, '📢 Introducing ZiDrop Logistics\' Dedicated Support System for Superior Customer Service! 🆕', '📢-introducing-zidrop-logistics\'-dedicated-support-system-for-superior-customer-service!-🆕', '<p>We are thrilled to announce the launch of our new dedicated support system for Zidrop Logistics. This system has been created to provide personalized assistance and guidance to ensure a seamless shipping experience for all our valued customers. With our support team at your service, you can look forward to prompt responses to any queries, proactive communication, and a superior level of customer satisfaction. We appreciate your decision to choose Zidrop Logistics.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For any assistance, please visit <strong>support.zidrop.com</strong> and submit a ticket.</p>', 1, 0, '2024-02-29 21:27:52', '2024-08-06 17:54:22'),
(13, 'Potential Delays in Delivery of Shipments  ⚠️💥', 'potential-delays-in-delivery-of-shipments--⚠️💥', '<p><strong>Dear Valued Customers</strong>,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We want to inform you about possible delays in shipment deliveries due to ongoing protests in several states. These protests have disrupted transportation and logistics, which may affect our usual delivery schedules.</p>\r\n\r\n<p>Our team is actively monitoring the situation and working hard to minimize any delays.</p>\r\n\r\n<p>We apologize for any inconvenience and appreciate your understanding and patience during this time.</p>\r\n\r\n<p>Thank you for your continued support.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Regards</strong>,</p>\r\n\r\n<p><strong>Management</strong></p>', 1, 0, '2024-08-06 17:47:36', '2024-08-18 08:05:49'),
(14, 'Payment Notice: Ensuring Secure Transactions with ZiDrop', 'payment-notice:-ensuring-secure-transactions-with-zidrop', '<p>Dear Merchants,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please inform your customers that all payments <strong>MUST</strong>&nbsp;be made directly to <strong>ZiDrop&#39;s Payment Terminals</strong>; payments given to delivery personnel or made in cash will not be accepted.</p>\r\n\r\n<p>Each Hub possesses a unique Virtual Terminal&nbsp;that provides immediate payment confirmation, typically within 8 seconds, accessible to both delivery staff and supervisors.</p>\r\n\r\n<p>Payment Terminal poster for each Hub can be downloaded from&nbsp;the&nbsp;Hubs page: <a href=\"https://zidrop.com/branches\">https://zidrop.com/branches</a>. Ensure your customers are duly advised.</p>\r\n\r\n<p>ZiDrop will not be responsible for any losses resulting from payments made outside of these designated accounts.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Sincerely,<br />\r\nManagement</strong></p>', 1, 1, '2024-08-21 08:02:59', '2024-09-12 09:01:00');
