INSERT INTO `parcel_type_describes` (`id`, `title`, `description`, `parcel_type_id`, `status`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(4, '', 'This indicates that the parcel has been created and is awaiting pickup.  We\'ve obtained the shipment details from the sender. Upon taking possession of the shipment and initiating its movement within our network, the status will be updated.', 1, 1, NULL, NULL, '2024-03-07 19:43:17', '2024-03-07 19:43:17'),
(5, '', 'This suggests that a ZiDrop executive has either received or collected the package \r\n           from a drop-off point and will now initiate processing for transportation to your designated \r\n           delivery or customer address.', 12, 1, NULL, NULL, '2024-03-07 19:44:16', '2024-03-07 19:44:16'),
(6, '', 'In transit signifies that your package has been picked up and is currently being transferred or en route to a ZiDrop distribution center nearer to the delivery address.', 2, 1, NULL, NULL, '2024-03-07 19:45:54', '2024-03-09 20:17:35'),
(7, '', 'This indicates that the package has left our main warehouse and reached a ZiDrop distribution center in proximity to the delivery address. Following this, the package will be expedited for delivery to the customer as soon as possible.', 10, 1, NULL, NULL, '2024-03-07 19:47:41', '2024-03-09 20:04:30'),
(8, '', 'This indicates that the package has been sorted and is currently in the possession of a delivery person. The carrier will attempt to deliver the package same day, though delivery may be delayed due to weather or other conditions.', 3, 1, NULL, NULL, '2024-03-07 19:50:05', '2024-03-09 08:55:14'),
(9, '', 'This status indicates the successful completion of the delivery process. It means that the parcel or package has been handed over to the intended recipient or left at the specified delivery location.', 4, 1, NULL, NULL, '2024-03-07 19:59:59', '2024-03-07 19:59:59'),
(10, '', 'This typically indicates that some items or contents within a parcel have been successfully delivered to the recipient, while the remaining items are slated for return to the merchant. To facilitate this process, the merchant must submit a ticket requesting that the delivery person deliver a portion of the package to the customer.', 6, 1, NULL, NULL, '2024-03-07 20:08:07', '2024-03-09 08:58:48'),
(11, '', 'A disputed parcel pertains to a shipment or delivery that is under dispute between the sender and ZiDrop. This scenario commonly arises when there is disagreement or discrepancy concerning the delivery, including issues such as missing items or damaged goods.', 5, 1, NULL, NULL, '2024-03-07 20:17:48', '2024-03-09 09:01:06'),
(12, '', 'This refers to a situation where a shipped item is redirected back to the central hub or distribution center rather than being delivered to its intended destination. Reasons could be any of the followings: Failed Delivery Attempts, Incorrect Address, Refused delivery by the customer and among others.', 7, 1, NULL, NULL, '2024-03-07 21:07:48', '2024-03-09 09:02:05'),
(13, '', '\"Return to merchant\" describes the process of sending a shipped item or parcel back to the original seller or sender. This commonly occurs when the recipient or customer is unable to receive the delivery, refuses the package, or provides an undeliverable address.', 8, 1, NULL, NULL, '2024-03-07 21:09:41', '2024-03-09 09:06:19'),
(14, '', 'This indicates a shipment that has been terminated or revoked before it reaches its intended destination. This cancellation can occur for various reasons, such as: Sender\'s Request, Operational Issues, Regulatory Issues.', 9, 1, NULL, NULL, '2024-03-07 21:13:32', '2024-03-07 21:13:32');
