INSERT INTO `prices` (`id`, `image`, `price`, `name`, `text`, `status`, `created_at`, `updated_at`) VALUES
(43, 'uploads/price/icon_solution.png', '', 'One Stop Solution', '<p>We understand how to make logistics work for our merchant partners. Our job is to let our partners focus on their core business while we take care of the rest.</p>', 1, '2021-10-02 21:21:14', '2024-09-09 10:09:25'),
(44, 'uploads/price/icon_wide_cover.png', '', 'Wide Coverage', '<p>We have a dedicated delivery channel of 350+ delivery agents. We have partnered with 50+ franchises all over the country as well.</p>', 1, '2021-10-02 21:23:03', '2024-09-09 11:17:43'),
(45, 'uploads/price/icon_track.png', '0', 'Full Tracking', '<p>Merchants have full access of tracking every step of the delivery. We provide end to end real time tracking facilities through email, sms and QR code.</p>', 1, '2021-10-02 21:24:15', '2024-09-09 08:10:10'),
(46, 'uploads/price/icon_delivey.png', '', 'Delivery confirmation with OTP', '<p>Two factor authentications - OTP verification is implemented at the time of delivery to ensure an additional layer of security to the delivered package.</p>', 1, '2021-10-02 21:24:15', '2024-09-09 10:25:33'),
(47, 'uploads/price/icon_truck_fast.png', '', 'Fastest Service', '<p>Our team works round the clock to ensure fastest delivery and minimize cancellation ratio so that we, as a business partner, can ensure our customer&rsquo;s growth.</p>', 1, '2021-10-02 21:24:15', '2024-09-09 10:28:24'),
(48, 'uploads/price/icon_cash-hand.png', '', 'Pay on Delivery (POD)', '<p>We collect payment&nbsp;from your customer and transfer it to you on time through a formal banking channel, and of course with all the detailed supporting information.</p>', 1, '2021-10-02 21:24:15', '2024-09-09 11:19:58');
