INSERT INTO `services` (`id`, `icon`, `image`, `title`, `text`, `status`, `created_at`, `updated_at`) VALUES
(1, NULL, 'uploads/service/P2PD.jpg', 'P2P Delivery Service', 'Person 2 Person Delivery: Whether you need to send your father’s reading glasses or surprise your mom with a handwoven shawl, we’ll make sure everything moves with flexibility, speed, and accuracy.', 1, '2020-12-30 09:12:43', '2024-09-24 09:10:00'),
(2, NULL, 'uploads/service/SME.jpg', 'Merchant Delivery Service', 'We understand the hustle you go through while building your business, we empathise with the nervousness of your very first-order. We are here as your partner with the flexibility to deliver things wherever and whenever', 1, '2020-12-30 09:13:02', '2024-09-24 09:10:21'),
(3, NULL, 'uploads/service/WRSD.jpg', 'Warehousing', 'When your dreams exceed the size of your storage, allow us to help. When you need more hands on board, to help with the storing, packaging and delivery of your products, we are there for you', 1, '2020-12-30 09:13:20', '2024-09-24 09:10:35'),
(4, NULL, 'uploads/service/EDS.jpg', 'Corporate & SME Delivery', 'From providing a hassle-free end-to-end delivery to making sure we accelerate your company’s efficiency, we help your business a great deal with each delivery. Our delivery solutions can be customised for big', 1, '2020-12-30 09:13:36', '2024-09-24 09:10:49'),
(5, NULL, 'uploads/service/ADS.jpg', 'Air Parcel', 'When things can’t wait to be sent the next day or the coming week, and you desperately want to send or receive something that very day, we are here for you as we understand the anticipation and urgency.', 1, '2021-02-15 06:12:20', '2024-09-24 09:11:01'),
(6, NULL, 'uploads/service/HDS.jpg', 'Line Haul', 'When your business needs a little push and you need a mode of transport to reach your customers, we can be of help, no matter how big the shipment or how far the destination.', 1, '2021-02-15 06:12:43', '2024-09-24 09:11:14');
